    Link
} from "react-router-dom";


function Stream() {
    return (
        <div >
            <Menu />
            <div style={{flexDirection:'row',flexWrap:'wrap',display:'flex', marginLeft: "10%",}}>
                <div style={{backgroundColor: 'red' }}>
                    Video stream gotaga :
                <ReactPlayer width='400px' height='300px' url='https://www.twitch.tv/gotaga' />
                </div>
                <div style={{backgroundColor: 'red' }}>
